import React from 'react';

function Food({ fav }) {
  return <h3>i love {fav}</h3>
}

const favroiteFood = [
  {
    name: "kimchi",
    price: "high"
  },
  {
    name: "gimbap",
    price: "chip"
  },
  {
    name: "짜장면",
    price: "middium"
  }
]

function App() {
  return <div className="App">
    <Food fav="noodle" name={true} fuck={[1, 2, 3, 4, 5, "hello"]} />
    <h1>Hello!!!</h1>
  </div>
}

export default App;
